import colors from './colors';

const PRIMARY_BORDER = `solid 2px ${colors.WHITE}`;
const SECONDARY_BORDER = `solid 1px ${colors.GREY}`;
const TERTIARY_BORDER = `solid 1px ${colors.BLACK}`;

// Units
export default ({
  primary: PRIMARY_BORDER,
  secondary: SECONDARY_BORDER,
  tertiary: TERTIARY_BORDER,
});
